import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function ProductSummary({ vehicle }) {
  return (
    <Col key={vehicle.id} md={4}>
      <Card className="mb-4 shadow">
        <Card.Img src={vehicle.image_link} alt="Vehicle" style={{ height: '320px' }} />
        <Card.Body>
          <Card.Title>{vehicle.vehicle_type}</Card.Title>
          <Card.Text>Model: {vehicle.model}</Card.Text>
          <Card.Text>Price: {vehicle.price}</Card.Text>
          {/* Use Link to navigate to the details page */}
          <Link to={`/details/${vehicle.id}`}>
            <Button variant="primary">See More</Button>
          </Link>
        </Card.Body>
      </Card>
    </Col>
  );
}

function Home() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    document.title = 'Home';
    Axios.get('http://127.0.0.1:8000/api/vehicles/')
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary" data-bs-theme="dark">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleverse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }}>
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000/sell/post">
                  ADD For Sell
                </NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000/rent/post">
                  ADD For Rent
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button className="me-2" variant="success">Search</Button>
            </Form>
            <Button variant="danger" href="http://127.0.0.1:8000/login/">Log Out</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>

      <Container className="mt-4">
        <h1 className="text-center">Vehicle List For Sell</h1>
        <Row>
          {vehicles.map((vehicle) => (
            <ProductSummary key={vehicle.id} vehicle={vehicle} />
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default Home;
